inity &amp;&amp; max !== -Infinity) {\n            pad = pad ? (max - min) * .03 : 0;\n            range.start = min - pad;\n            range.end = max + pad;\n        } else console.error('backtesting: scale range error:', min, max, range);\n    };\n}\n\nclearTimeout(window._bt_autoscale_timeout);\n\nwindow._bt_autoscale_timeout = setTimeout(function () {\n    /**\n     * @variable cb_obj `fig_ohlc.x_range`.\n     * @variable source `ColumnDataSource`\n     * @variable ohlc_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"551711","type":"CustomJS"},{"attributes":{},"id":"551390","type":"BasicTicker"},{"attributes":{},"id":"551920","type":"StringFormatter"},{"attributes":{"dimensions":"width","maintain_focus":false},"id":"551438","type":"WheelZoomTool"},{"attributes":{},"id":"551921","type":"StringEditor"},{"attributes":{"border_line_color":"#333333","click_policy":"hide","coordinates":null,"group":null,"items":[{"id":"551491"},{"id":"551514"},{"id":"551539"},{"id":"551566"}],"label_text_font_size":"8pt","location":"top_left","margin":0,"padding":5,"spacing":0},"id":"551490","type":"Legend"},{"attributes":{},"id":"551922","type":"StringFormatter"},{"attributes":{},"id":"551867","type":"StringEditor"},{"attributes":{},"id":"551923","type":"StringEditor"},{"attributes":{"dimensions":"width","maintain_focus":false},"id":"551584","type":"WheelZoomTool"},{"attributes":{"axis":{"id":"551575"},"coord
